INSERT INTO tblContent VALUES (7615,0,'<we:createShop shopname=\"shopers\"/><table width=\"265\" border=\"0\">\n <tr>\n   <td>&nbsp;</td>\n   <td class=\"small\" bgcolor=\"silver\" align=\"center\" colspan=\"3\"><we:a id=\"148\">to the basket</we:a></td>\n </tr>\n<we:repeatShopItem shopname=\"shopers\">\n <tr>\n  <td>&nbsp;</td>\n  <td class=\"small\"  bgcolor=\"white\"><we:field name=\"Bild\" type=\"img\" hyperlink=\"on\" border=\"0\" height=\"30\" width=\"30\" align=\"top\"/></td> \n  <td class=\"small\" ><we:showShopItemNumber shopname=\"shopers\"/> x <b><we:field name=\"Artikelname\" alt=\"we_path\" hyperlink=\"on\"/></b><br>Total: EURO <we:calculate sum=\"waren\" num_format=\"english\"><we:showShopItemNumber shopname=\"shopers\">*<we:field name=\"Preis\"/></we:calculate></td>\n  <td bgcolor=\"white\" border=\"0\" height=\"30\" width=\"30\" align=\"left\"><we:a id=\"self\" delarticle=\"on\"><img src=\"/we_demo/shop/images/basket_out2.gif\" width=\"26\" height=\"26\" border=\"0\"></we:a></td>\n</tr>    \n</we:repeatShopItem>\n<tr>\n <td colspan=\"4\">&nbsp;</td>\n </tr>\n<tr>\n <td></td>\n <td align=\"left\" colspan=\"3\">\n   <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n      <tr><td class=\"small\" colspan=\"2\" align=\"center\" bgcolor=\"silver\"><b>Sum</b></td></tr>\n      <tr><td class=\"small\" align=\"right\"><b>Euro:&nbsp;</b></td><td class=\"normal\" align=\"right\"><we:sum name=\"waren\" num_format=\"english\"/></td></tr>\n      </tr><td class=\"small\" align=\"right\">(incl. VAT):&nbsp;</td><td class=\"normal\" align=\"right\"><we:addPercent percent=\"16\" num_format=\"english\"><we:sum name=\"waren\"/></we:addPercent></td></tr>\n   </table>\n </td>\n</tr>\n</table>',0,'',0);
