INSERT INTO tblContent VALUES (7613,0,'<html>\n   <head>\n      <we:title>Shop</we:title>\n      <we:description>Demo-Website for the CMS webEdition</we:description>\n      <we:keywords>cms,webEdition</we:keywords>\n      <link href=\"<we:url id=\"89\" />\" rel=\"styleSheet\" type=\"text/css\">\n   </head>\n   <body  background=\"/we_demo/layout_images/bg.gif\" bgcolor=\"white\" leftmargin=\"0\" marginwidth=\"0\" topmargin=\"8\" marginheight=\"8\">\n <we:ifshopexists>\n     <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\">\n         <tr>\n            <td width=\"27\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/we_logo.gif\" width=\"50\" height=\"50\" border=\"0\"></td>\n            <td width=\"54\"></td>\n            <td><span class=\"headline\">&nbsp;Shop-Channel - </span><span class=\"headline_small\">Item</span></td>\n            <td class=\"normal\" width=\"74\"></td>\n         </tr>\n         <tr>\n            <td width=\"27\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"27\" height=\"10\" border=\"0\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"50\" height=\"10\" border=\"0\"></td>\n            <td width=\"54\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"54\" height=\"10\" border=\"0\"></td>\n            <td><img src=\"/we_demo/layout_images/pixel.gif\" width=\"418\" height=\"10\" border=\"0\"></td>\n            <td width=\"74\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"71\" height=\"10\" border=\"0\"></td>\n         </tr>\n         <tr>\n            <td class=\"normal\" width=\"27\"></td>\n            <td colspan=\"2\" class=\"normal\" valign=\"top\"><we:include id=\"90\"/></td>\n            <td bgcolor=\"white\" colspan=\"2\" valign=\"top\">\n               <table cellpadding=\"6\" cellspacing=\"0\" border=\"0\">\n                  <tr>\n                     <td valign=\"top\" class=\"normal\">\n                         <we:ifEditmode><span class=\"normal\"><b>Item name:</b></span><br></we:ifEditmode><span class=\"headline_small\"><we:input type=\"text\" name=\"Artikelname\" size=\"60\"/></span><br><br>\n<we:ifNotEmpty match=\"Bild\">\n                         <table <we:ifNotEditmode>align=\"right\" </we:ifNotEditmode>cellpadding=\"5\" cellspacing=\"0\" border=\"0\" width=\"60\">\n                            <tr>\n                               <td><we:img name=\"Bild\"/></td>\n                           </tr>\n<we:ifNotEmpty match=\"Caption\">\n                           <tr>\n                              <td class=\"small\"><we:ifEditmode><span class=\"normal\"><b>Caption:</b></span><br></we:ifEditmode><we:textarea name=\"Bildunterschrift\" rows=\"2\" cols=\"25\"/></td>\n                          </tr>\n </we:ifNotEmpty>\n                      </table>\n  </we:ifNotEmpty>\n                     <we:textarea name=\"Text\" cols=\"60\" rows=\"10\" autobr=\"on\" dhtmledit=\"on\" showMenues=\"on\" importrtf=\"on\"/>\n<we:ifEditmode><br><br><span class=\"norm12\"><b>Price:</b></span><br></we:ifEditmode><br><span class=\"normal\"><b>EURO<b> <we:input type=\"text\" name=\"Preis\" size=\"60\" num_format=\"english\"/></span>\n<br><br><we:a id=\"148\" shop=\"on\">[Order]</we:a>					 \n</td>\n                 </tr>\n              </table> \n <we:ifEditmode><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n<tr><td class=\"norm12\"><b>Order:</b></td><td><we:input type=\"text\" name=\"Ordnung\" size=\"2\"/></td></tr>\n<tr><td class=\"norm12\"><b>Item title:</b></td><td><we:input type=\"text\" name=\"shoptitle\" size=\"30\"/></td></tr>\n<tr><td class=\"norm12\"><b>Item description:</b></td><td><we:textarea rows=\"5\" cols=\"30\" name=\"shopdescription\"/></td></tr>\n</table></we:ifEditmode>         \n            </td>\n<td valign=\"top\"><we:include id=\"149\"/> </td>\n         </tr>\n      </table>\n<we:else/>\nUnfortunately the shop is not installed!\n</we:ifshopexists>\n   </body>\n</html>\n',0,'',0