INSERT INTO tblContent VALUES (7614,0,'<html>\n   <head>\n      <we:title>Shop</we:title>\n      <we:description>Example webSite webEdition</we:description>\n      <we:keywords>cms,webEdition</we:keywords>\n      <link href=\"<we:url id=\"89\" />\" rel=\"styleSheet\" type=\"text/css\">\n   </head>\n   <body  background=\"/we_demo/layout_images/bg.gif\" bgcolor=\"white\" leftmargin=\"0\" marginwidth=\"0\" topmargin=\"8\" marginheight=\"8\">\n <we:ifshopexists>\n     <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"620\" class=\"normal\" >\n         <tr>\n            <td width=\"27\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/we_logo.gif\" width=\"50\" height=\"50\" border=\"0\"></td>\n            <td width=\"54\"></td>\n            <td><span class=\"headline\">&nbsp;Shop-Chanel - </span><span class=\"headline_small\">Basket</span></td>\n            <td class=\"normal\" width=\"74\"></td>\n         </tr>\n         <tr>\n            <td width=\"27\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"27\" height=\"10\" border=\"0\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"50\" height=\"10\" border=\"0\"></td>\n            <td width=\"54\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"54\" height=\"10\" border=\"0\"></td>\n            <td><img src=\"/we_demo/layout_images/pixel.gif\" width=\"418\" height=\"10\" border=\"0\"></td>\n            <td width=\"74\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"71\" height=\"10\" border=\"0\"></td>\n         </tr>\n         <tr>\n            <td class=\"normal\" width=\"27\"></td>\n            <td colspan=\"2\" class=\"normal\" valign=\"top\"><we:include id=\"90\"/></td>\n            <td bgcolor=\"white\" colspan=\"2\" valign=\"top\">\n\n<we:createShop shopname=\"shopers\"/><we:addDelShopItem shopname=\"shopers\"/>\n<table width=\"100%\" border=\"0\">\n<tr bgcolor=\"silver\">\n<td class=\"normal\">Article</td>\n<td class=\"normal\" width=\"50\">Amount</td>\n<td class=\"normal\">Price</td>\n<td class=\"normal\">Total</td>\n</tr>\n<we:repeatShopItem shopname=\"shopers\">\n                                <tr>\n                                   <td class=\"normal\"  bgcolor=\"white\"><table border=\"0\"><tr><td><we:field name=\"Bild\" type=\"img\" hyperlink=\"on\" border=\"0\" height=\"30\" width=\"30\" align=\"top\"/>\n		</td><td class=\"normal\" ><b><we:field name=\"Artikelname\" alt=\"we_path\" hyperlink=\"on\"/></b><br><we:field name=\"shopdescription\" alt=\"we_text\" max=\"200\"/></td>\n</tr></table>\n<td align=\"center\" class=\"normal\"><we:showShopItemNumber shopname=\"shopers\"/><br>[<we:a id=\"148\" shop=\"on\" amount=\"1\">+1</we:a>|<we:a id=\"148\" shop=\"on\" amount=\"-1\">-1</we:a>]</td>\n<td class=\"normal\"><we:field name=\"Preis\"/></td>\n<td  align=\"right\" class=\"normal\">EURO <br><we:calculate sum=\"warenkorb\" num_format=\"english\"><we:showShopItemNumber shopname=\"shopers\">* <we:field name=\"Preis\"/></we:calculate></td>\n\n</td>\n                                </tr>\n\n\n</we:repeatShopItem>\n<tr><td colspan=\"4\"></td></tr>\n<tr bgcolor=\"silver\"><td class=\"normal\" colspan=\"3\">Total sum:</td><td align=\"right\" class=\"normal\">\n EURO <br> <we:sum name=\"warenkorb\" num_format=\"english\"/>\n</td></tr>\n</table><br><br><br>\n<table>\n <td align=\"left\" class=\"normal\">\n  <we:a id=\"self\" shopname=\"shopers\" delshop=\"on\"> Delete basket</we:a>\n </td>\n <td width=\"240\"></td>\n <td align=\"right\" class=\"normal\"> \n  <we:a id=\"157\">Cashier</we:a>\n </td>\n</table>\n\n            </td>\n<td valign=\"top\"><we:include id=\"149\"/> </td>\n         </tr>\n      </table>\n<we:else/>\nUnfortunately the Shop management is not installed! \n</we:ifshopexists>\n   </body>\n</html>\n',0,'',0);
