/we:ifNotFound>\n                      </table>\n</we:listview>\n<we:else/>\nUnfortunately the shop is not installed!\n</we:ifshopexists>\n                    </td>\n                 </tr>\n              </table>              \n            </td>\n<td valign=\"top\"><we:ifshopexists><we:include id=\"149\"/></we:ifshopexists> </td>\n         </tr>\n      </table>\n   </body>\n</html>\n',0,'',0);
