INSERT INTO tblContent VALUES (7616,0,'<we:ifcustomerexists><we:sessionStart/><we:saveRegisteredUser/></we:ifcustomerexists>\n<html>\n   <head>\n      <we:title>CMS Channel</we:title>\n      <we:description>Demo-Website for the CMS webEdition</we:description>\n      <we:keywords>cms,webEdition</we:keywords>\n      <link href=\"<we:url id=\"89\" />\" rel=\"styleSheet\" type=\"text/css\">\n   </head>\n   <body  background=\"/we_demo/layout_images/bg.gif\" bgcolor=\"white\" leftmargin=\"0\" marginwidth=\"0\" topmargin=\"8\" marginheight=\"8\">\n <we:ifcustomerexists><we:registerSwitch/></we:ifcustomerexists>\n     <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\">\n         <tr>\n            <td width=\"27\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/we_logo.gif\" width=\"50\" height=\"50\" border=\"0\"></td>\n            <td width=\"54\"></td>\n            <td><span class=\"headline\">&nbsp;CMS Channel - </span><span class=\"headline_small\">Customer login</span></td>\n            <td class=\"normal\" width=\"74\"></td>\n         </tr>\n         <tr>\n            <td width=\"27\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"27\" height=\"10\" border=\"0\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"50\" height=\"10\" border=\"0\"></td>\n            <td width=\"54\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"54\" height=\"10\" border=\"0\"></td>\n            <td><img src=\"/we_demo/layout_images/pixel.gif\" width=\"418\" height=\"10\" border=\"0\"></td>\n            <td width=\"74\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"71\" height=\"10\" border=\"0\"></td>\n         </tr>\n         <tr>\n            <td class=\"normal\" width=\"27\"></td>\n            <td colspan=\"2\" class=\"normal\" valign=\"top\"><we:include id=\"90\"/></td>\n            <td bgcolor=\"white\" colspan=\"2\" valign=\"top\"><we:ifcustomerexists>\n               <table cellpadding=\"6\" cellspacing=\"0\" border=\"0\">\n                  <tr>\n                  <we:ifRegisteredUser>\n                  <td colspan =\"2\" class =\"normal\">\n                  Hallo <we:sessionField name=\"Username\" type=\"print\"/>,<br><br>please check your customer data again. If everything is correct, please press \"send order\". If you want to change the data, please press \"change\"!<br><br>\n\n                  <br><table border=\"0\" cellpadding=\"4\" cellspacing=\"0\">\n                            <tr><td class =\"normal\"><b>Firstname:</b></td><td class =\"normal\"><we:sessionField name=\"Forename\" type=\"print\"/></td></tr>\n                            <tr><td class =\"normal\"><b>Name:</b></td><td class=\"normal\"><we:sessionField name=\"Surname\" type=\"print\"/></td></tr>\n                            <tr><td class =\"normal\"><b>Adress 1:</b></td><td class =\"normal\"><we:sessionField name=\"Contact_Address1\" type=\"print\"/></td></tr>\n                            <tr><td class =\"normal\"><b>Adress 2:</b></td><td class =\"normal\"><we:sessionField name=\"Contact_Address2\" type=\"print\"/></td></tr>\n                            <tr><td class =\"normal\"><b>Country:</td><td class =\"normal\"><we:sessionField name=\"Contact_Country\" type=\"print\"/></tr></td>\n                         </table>\n                   <br><form><input type=\"button\" value=\"change\" onClick=\"self.location=\'<we:url id=\"156\"/>\'\">&nbsp;&nbsp;<input type=\"button\" value=\"send order\" onClick=\"self.location=\'<we:url id=\"173\"/>\'\"></form>\n                    </td>\n                    </we:ifRegisteredUser>\n\n                    <we:ifNotRegisteredUser>\n                    <td colspan=\"2\" class=\"normal\">  <we:form id=\"self\">\n<we:ifLoginFailed>\n                  <font color=\"red\">Username and/or password incorrect!</font><br>\n<we:else/>\n                   \n                      Dear webEdition customer,<br><br> \n                      if you visit our shop for the first time, please click <we:a id=\"156\">here</we:a>.<br>\n                      <br>\n                      If you already are a registered customer, please enter your username and password into the appropriate fields and press \"login\".<br>\n </we:ifLoginFailed>                     \n                    </td>\n                  </tr> \n                 <tr>\n                   <td width=\"120\" align=\"top\" class=\"normal\">\n                   Username:\n                   </td> \n                    <td align=\"top\">\n                    <we:sessionField name=\"Username\" type=\"textinput\"/>\n                   </td>\n                 </tr>\n                 <tr>\n                   <td width=\"120\" align=\"top\" class=\"normal\"> \n                    Password:\n                   \n                     </td>\n                   <td align=\"top\">\n                    <we:sessionField name=\"Password\" type=\"password\"/>\n                   </td>\n                 </tr>\n                 <tr>\n                   <td colspan=\"2\">             \n                      <input type=\"submit\" value=\"login\">\n                       </we:form>\n                   </td>\n                    </we:ifNotRegisteredUser>\n                 </tr>\n              </table>\n<we:else/>\nUnfortunately the customer management is not installed!\n</we:ifcustomerexists>        \n            </td>\n<td valign=\"top\"><we:ifshopexists><we:include id=\"149\"/></we:ifshopexists> </td>\n         </tr>\n      </table>\n   </body>\n</html>\n\n\n\n\n',0,'',0);
