         </tr>\n         <tr>\n            <td class=\"normal\" width=\"27\"></td>\n            <td colspan=\"2\" class=\"normal\" valign=\"top\"><we:include id=\"90\"/></td>\n            <td bgcolor=\"white\" colspan=\"2\" valign=\"top\">\n               <table cellpadding=\"6\" cellspacing=\"0\" border=\"0\">\n                  <tr>\n                     <td valign=\"top\" class=\"normal\">\n<we:ifobjektexists> \n<we:listview type=\"object\" classid=\"1\" order=\"Name1\" categories=\"we_doc\" rows=\"6\">\n                          <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"500\">\n<we:repeat>\n                                <tr>\n                                   <td class=\"normal\">\n                                      <b><we:field name=\"Name1\" /></b><br>\n                                      <we:ifFieldNotEmpty match=\"Name2\"><we:field name=\"Name2\"/><br></we:ifFieldNotEmpty>\n                                      <we:field name=\"Street\"/><br>\n                                      <we:field name=\"ZIP\"/>&nbsp;<we:field name=\"City\"/>\n                                      <we:ifFieldNotEmpty match=\"Phone\"><br><we:field name=\"Phone\"></we:ifFieldNotEmpty>\n                                      <we:ifFieldNotEmpty match=\"Email\"><br><a href=\"mailto:<we:field name=\"Email\"/>\"><we:field name=\"Email\"/></a></we:ifFieldNotEmpty>\n                                     <we:ifFieldNotEmpty match=\"URL\"><br><a href=\"<we:field name=\"URL\"/>\" target=\"_blank\"><we:field name=\"URL\"/></a></we:ifFieldNotEmpty>\n                                   </td>\n                                </tr>\n                                <tr>\n                                   <td><img src=\"/we_demo/layout_images/pixel.gif\" width=\"500\" height=\"10\" border=\"0\"></td>\n                               </tr>\n</we:repeat>\n <we:ifNotFound>\n                                 <tr>\n                                   <td colspan=\"3\" class=\"nor