INSERT INTO tblContent VALUES (7624,0,'<we:ifnewsletterexists><we:ifHtmlMail><we:ifFemale>Dear Ms.<we:newsletterSalutation type=\"title\" /> <we:newsletterSalutation type=\"lastname\" />,<br><br>\n\n<we:else /><we:ifMale>Dear Mr.<we:newsletterSalutation type=\"title\" /> <we:newsletterSalutation type=\"lastname\" />,<br><br>\n\n<we:else />Dear Customer,<br><br>\n\n</we:ifMale></we:ifFemale>please ckick the following link to confirm the entry in our newsletter: <we:newsletterConfirmLink/><br><br>Vielen Dank Ihr CMS-Kanal Team\n<we:else><we:ifFemale>Dear Ms.<we:newsletterSalutation type=\"title\" /> <we:newsletterSalutation type=\"lastname\" />,\n\n<we:else /><we:ifMale>Dear Mr.<we:newsletterSalutation type=\"title\" /> <we:newsletterSalutation type=\"lastname\" />,\n\n<we:else />Dear Customer,\n\n</we:ifMale></we:ifFemale>please ckick the following link to confirm the entry in our newsletter: <we:newsletterConfirmLink/>\n\n\nThanks, your CMS Channel Team</we:ifHtmlMail><we:else/>The Newsletter Module is not installed!</we:ifnewsletterexists>',0,'',0);
INSERT INTO tblContent VALUES (7543,0,'If you would like to be updated about future plans of<b> CMS Channel</b>,\nplease provide us with your name and email address. Your\ndetails will only be used in conjunction with information pertaining to\nCMS Channel and will not be passed on the third parties. If you don\'t\nwant to receive our newsletter anymore, please unsubscribe by entering\nyour email address in the field provided.',0,'',0);
INSERT INTO tblContent VALUES (7617,0,'<we:ifcustomerexists><we:sessionStart/></we:ifcustomerexists>\n<html>\n   <head>\n      <we:title>CMS Channel</we:title>\n      <we:description>Demo-Website for the CMS webEdition</we:description>\n      <we:keywords>cms,webEdition</we:keywords>\n      <link href=\"<we:url id=\"89\" />\" rel=\"styleSheet\" type=\"text/css\">\n   </head>\n   <body  background=\"/we_demo/layout_images/bg.gif\" bgcolor=\"white\" leftmargin=\"0\" marginwidth=\"0\" topmargin=\"8\" marginheight=\"8\">\n<we:ifcustomerexists><we:registerSwitch /></we:ifcustomerexists> \n     <table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"600\">\n         <tr>\n            <td width=\"27\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/we_logo.gif\" width=\"50\" height=\"50\" border=\"0\"></td>\n            <td width=\"54\"></td>\n            <td><span class=\"headline\">&nbsp;CMS Channel - </span><span class=\"headline_small\">Customer data</span></td>\n            <td class=\"normal\" width=\"74\"></td>\n         </tr>\n         <tr>\n            <td width=\"27\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"27\" height=\"10\" border=\"0\"></td>\n            <td width=\"50\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"50\" height=\"10\" border=\"0\"></td>\n            <td width=\"54\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"54\" height=\"10\" border=\"0\"></td>\n            <td><img src=\"/we_demo/layout_images/pixel.gif\" width=\"418\" height=\"10\" border=\"0\"></td>\n            <td width=\"74\"><img src=\"/we_demo/layout_images/pixel.gif\" width=\"71\" height=\"10\" border=\"0\"></td>\n         </tr>\n         <tr>\n            <td class=\"normal\" width=\"27\"></td>\n            <td colspan=\"2\" class=\"normal\" valign=\"top\"><we:include id=\"90\"/></td>\n            <td bgcolor=\"white\" colspan=\"2\" valign=\"top\">\n               <we:ifcustomerexists><table cellpadding=\"6\" cellspacing=\"0\" border=\"0\" class=\"normal\">\n                  <tr>\n                  <we:form id=\"157\" method=\"get\"><we:sessionField name=\"ID\" type=\"hidden\"/>\n                  <td width=\"120\" align=\"top\">Username: </td>\n                  <td><we:ifRegisteredUser><we:sessionField name=\"Username\" type=\"print\"/><we:else/><we:sessionField name=\"Username\" type=\"textinput\"/></we:ifRegisteredUser></td>\n                  </tr> \n                  <tr>\n                  <td width=\"120\" align=\"top\">Password: </td>\n                  <td><we:sessionField name=\"Password\" type=\"password\"/></td>\n                  </tr> \n <tr>\n                  <td width=\"120\" align=\"top\"><br></td>\n                  <td><br></td>\n                  </tr> \n                  <tr>\n                  <td width=\"120\" align=\"top\">First Name: </td>\n                  <td class=\"normal\"><we:sessionField name=\"Forename\" type=\"textinput\"/></td>\n                  </tr>  \n                  <tr>\n\n                  <td width=\"120\" align=\"top\">Last Name: </td>\n                  <td><we:sessionField name=\"Surname\" type=\"textinput\"/></td>\n                  </tr>  \n                  <tr>\n\n                  <td width=\"120\" align=\"top\">Adress1: </td>\n                  <td><we:sessionField name=\"Contact_Address1\" type=\"textinput\"/></td>\n                  </tr>  \n                  <tr>\n\n                  <td width=\"120\" align=\"top\">Adress2: </td>\n                  <td><we:sessionField name=\"Contact_Address2\" type=\"textinput\"/></td>\n                  </tr>\n                  <tr>\n\n                  <td width=\"120\" align=\"top\">Country: </td>\n                  <td><we:sessionField name=\"Contact_Country\" type=\"textinput\"/></td>\n                  </tr>\n                  <tr>\n\n                  <td colspan=\"2\" align=\"top\"><input type=\"button\" value=\"back\" onClick=\"javascript:history.back()\">&nbsp;&nbsp;<input type=\"submit\" value=\"<we:ifNotRegisteredUser>save<we:else>Change data</we:ifNotRegisteredUser>\"> </td>\n                  </tr>                  \n                   </we:form>\n              </table> \n <we:else/>\nUnfortunately the customer management is not installed! \n</we:ifcustomerexists>       \n            </td>\n<td valign=\"top\"><we:ifshopexists><we:include id=\"149\"/></we:ifshopexists> </td>\n         </tr>\n      </table>\n   </body>\n</html>\n\n\n',0,'',0);
